export default {
  sort(data, variable) {
    if (data) {
      return data.sort((a, b) => {
        if (variable) {
          return a[variable] > b[variable] ? 1 : -1;
        } else {
          return a > b ? 1 : -1;
        }
      });
    }
  },
  async getStates() {
    let stateList = await _.groupBy(states, (item) => {
      return item.state;
    });
    return this.sort(Object.keys(stateList), null);
  },
  async getStatesObject() {
    let stateList = await _.groupBy(states, (item) => {
      return item.state;
    });
    let sorted = this.sort(Object.keys(stateList), null);
    if (sorted && sorted.length > 0) {
      return sorted.map((item) => {
        return {
          title: item,
          value: null,
        };
      });
    }
  },
  async getRegions(state) {
    let stateList = await states.filter((item) => {
      return item.state == state;
    });
    let regions = await _.groupBy(stateList, (item) => {
      return item.region;
    });
    return this.sort(Object.keys(regions), null);
  },
  async getSuburb(state, region) {
    let data = await states.filter((item) => {
      return item.state == state && item.region == region;
    });
    return await this.sort(data, "suburb");
  },
};
